description:
A lot of girls head off to college with stars in their eyes and dreams of Bachelor's degrees swimming through their heads. Some girls, though, just want to see the inside of every frat house bedroom or boy's dorm bunk bed that they can. These cum-drunk college whores are the darlings of every undergrad mixer and can often be found at any off-campus basement bash hovering near the keg of cheap local beer. Don't be afraid to introduce yourself to these acquiescent young co-eds; they're going to be proud to do the walk of shame from your dorm room in the morning with a little dried spunk on their chins!

